INSERT INTO `ak419_article` VALUES (1,6,' 關於我們-AKMALL訂單系統','','','',1,0,'<p><span style=\"font-size: 18px;\">1、自适应电脑和手机界面，界面精美，模板可自定义。</span></p><p><span style=\"font-size: 18px;\">2、独立后台方便管理，产品可在后台上传修改，订单可导出Excel表。</span></p><p><span style=\"font-size: 18px;\">3、集成Facebook Pixel（像素）追踪功能，完美适用在FB投放COD。</span></p><p><span style=\"font-size: 18px;\">4、精美的模板，非市面上粗俗烂作的模板与之可比；模板可随意切换且能自定义样式，让您的页面总是与众不同。</span></p><p><span style=\"font-size: 18px;\">5、防刷单防丢单，邮件即时通知。</span></p><p><span style=\"font-size: 18px;\">6、可计算运费，设置推广渠道，物流查询等等……</span></p><p><span style=\"font-size: 18px;\">7、可扩展性强，支持嵌入第三方数据统计代码和第三方客服系统等；</span></p><p><span style=\"font-size: 18px;\">8.更多详细说明请阅读使用文档</span><a href=\"http://doc.akmall.cc\" target=\"_blank\" style=\"color: rgb(0, 176, 80); text-decoration: underline;\"><span style=\"font-size: 18px;\">http://doc.akmall.cc</span></a></p><p><br/></p>',0,0,1543832667,1543831330),(3,6,'物流條款','','','',1,0,'<p><strong>1、配送範圍與運費&nbsp;</strong></p><p>配送範圍全台灣、免運費&nbsp;<br/></p><p><strong>2、配送時間&nbsp;</strong></p><p>下單成功之後，我們會按照下單先後順序進行配貨，配貨週期為3個工作日左右；不限定時間送貨和指定時段送貨、星期六週日及國定假日可以提供收送服務&nbsp;</p><p><strong>3、到貨時間&nbsp;</strong></p><p>訂單完成後到達時間為7個工作日左右&nbsp;</p><p><strong>4、簽收須知&nbsp;</strong></p><p>&nbsp; 下單時，請盡量留下本人能夠簽收的地址與聯絡電話。&nbsp;</p><p>收到商品時請當場驗貨，檢查外包裝是否完好，商品種類數量是否與訂單明細相符，購物清單是否齊全，不提供簽收前拆開手機包裝驗貨。如果外箱封條出現破損或者撕開，您有權選擇拒收。</p><p>但對於封條完好，開箱後缺料等異常情況，請您聯繫我們24小時在線客服，並保持包裹原樣。</p><p>在本人不能親自簽收的情況下，請委託他人簽收並嚴格按照第二項內容操作。配送快遞員只負責派送貨物給快遞單指定位址，該位址任何人都可以簽收例如櫃台，不保證派送給指定的人。</p><p>出於風險考慮，您的訂單在確認購買後無法修改地址和電話，還請在下單時務必填入正確的地址和電話。爲您帶來的麻煩我們表示抱歉。</p><p>即日起，因資訊不足無法配送的滯留訂單將會被配送方保留5日。我們將會以電子郵件的形式通知用戶，請回覆信箱中的郵件或聯繫客服人員。逾期5日未能得到回覆的訂單我們將安排返回倉庫及退款。由此給您帶來的不便，敬請諒解。</p><p><strong>5、退貨退款&nbsp;</strong></p><p>1、如果您所訂購的商品有瑕疵，您可以要求全額退費</p><p>2、關於退貨退款方式及條件，依各該商品銷售網頁及訂購流程中之相關網頁之記載&nbsp;</p><p>3、您所退回的商品，必須保持所有商品、贈品、附件、包裝、及所有附隨文件或資料在出貨當時狀態的完整性，如果有實體發票，並應連同發票一併退回及簽署折讓單等相關法令所要求之單據；否則，我們得拒絕接受您的退貨退款要求。&nbsp;</p><p>4、您瞭解並同意，若因您要求退貨或換貨、或因我們無法接受您全部或部分之訂單、或契約因故解除或失其效力，而需為您辦理退款事宜時，我們得代您處理發票或折讓單等相關法令所要求之單據&nbsp;</p><p><strong>6、配送常見問題&nbsp;</strong></p><p>Q1：下單時可以指定送貨時間嗎？&nbsp;</p><p>A1：依照訂單運輸信息中的「運輸公司」對應不同送貨時間。可以選擇，指定時段送貨（時段為：13時前和14時~18時）送貨，不含週日。</p><p>Q2: 如何投訴快遞人員？</p><p>A2: 依照訂單運輸信息中的「運輸公司」對應不同快遞公司，客戶可以聯絡當地的服務熱線</p><p>&nbsp; Q3：配送需要多長時間？&nbsp;</p><p>A3：正常情況下，自訂單出庫日起，7個工作日左右即可送達（不含週日）。</p><p>&nbsp; Q4：簽收驗貨需注意什麼？&nbsp;</p><p>A4：請確保外包裝完好，收件人可以拒絕收取外包裝破損的貨物。&nbsp;</p><p>&nbsp; Q5：收貨時是否需要提供證件？&nbsp;</p><p>A5： 不需要。快遞員只負責派送貨物給快遞單指定位址，該位址任何人都可以簽收例如櫃台。不保證派送給指定的人。&nbsp;</p><p>&nbsp; Q6：被他人簽收了，怎麼辦？&nbsp;</p><p>A6：如出現此種情況，請依照訂單運輸信息中的「運輸公司」聯絡對應的快遞公司。 請聯絡當地的服務熱線。&nbsp;</p><p>&nbsp; Q7：如何查詢合作廠商配送的狀態？&nbsp;</p><p>A7：請依照訂單運輸信息中的「運輸公司」查詢對應的快遞公司可以查詢貨物狀態。&nbsp;</p><p>&nbsp; 我們客服將七天24小時在線為您回復郵件</p><p><br/></p>',0,0,1543832670,1543832133),(4,6,'服務條款','','','',1,0,'<p>感謝您瀏覽。您可以根據以下服務條款及任何其他本網站所提及的條例存取或使用本網站或相關服務。使用服務, 例如於本網站訂購商品, 即表示您同意所有服務條款。 本協議並不承認您與我們的任何關係 (合夥、合作、僱用或其他形式) 。本協議並不賦予您成為我們的代表。我們保留在任何時間更改本網站、相關政策及協議、隱私聲明以及本服務條款的權利。您應該定時瀏覽本網站, 查看上述的政策及協議、隱私聲明以及本服務條款的更新或更改。</p><p><strong>知識產權</strong></p><p>我們的所有軟件和內容 (其定義為, 或包括任何文字、音訊或音樂、影片、圖像、相片和圖片) 是我們的知識產權作品, 並受知識產權、版權法和國際公約條款的保護。本網站只供作個人及非商業用途。只有得到我們及/或其第三方授權人明確授權, 方可使用內容作任何非個人及/ 或非商業用途。在未獲我們同意或授權前, 不可發佈、複製、售賣或特許任何本網站的內容。任何未經授權的行為可能會導致民事後果或刑事處罰。</p><p>我們保留在沒有通知的情況下撤消或修改任何服務的權利。若本網站因任何理由在任何時間或任何期間無法使用, 我們概不負責。</p><p><strong>產品描述</strong></p><p>我們將盡力確保本網站的內容和產品描述為準確和完整。不過, 我們不保證內容和產品描述均為準確、完整、最新和無誤。如果您覺得我們提供的產品與描述不符, 請參閱我們的退貨及退款程序。</p><p><strong>價格</strong></p><p>本網站所標示的價格為新臺幣。除非出現明顯錯誤, 否則您的訂單獲接納時即代表您同意支付本網站所顯示的價格。我們盡力確保本網站所顯示的所有價格準確, 但不能保證所有價格無誤, 並保留更正任何錯誤的權利。如果我們發現您已訂購的任何產品價格有誤, 我們會盡快通知您,屆時您可選擇重新確認或取消訂單。如果未能聯絡閣下, 我們將把訂單作取消訂單般處理。</p><p><strong>接受訂單</strong></p><p>當您輸入個人資料、付款資料並提交訂單, 我們將向您發出電郵以確認收到訂單。該電郵僅確認收到訂單, 並不代表接受訂單。我們向您發出電郵確認貨品已經寄出時, 即表示您的訂單已獲接受, 而您與我們的合約亦已完成。只有在寄出商品時發出的確認電郵中列出的商品包括於合約中。</p><p><strong>我們保留權利因任何原因自行決定不接受訂貨。原因包括但不限於以下其一：</strong></p><p><em><span style=\"text-decoration: none;\">a) 你所訂購的商品缺貨, 或因為未能達到我們的品質標準或因為其中一項或全部訂購商品適用於送貨限制而被撤回。</span></em></p><p><em><span style=\"text-decoration: none;\">b) 我們發現價格或產品描述有誤</span></em></p><p><em><span style=\"text-decoration: none;\">c) 我們未能獲得付款授權</span></em></p><p><em><span style=\"text-decoration: none;\">d) 您不符合服務條款載列的購買資格</span></em></p><p>如果您的訂單有任何問題, 我們的客戶服務團隊會盡快聯絡您。</p><p><strong>送貨和取貨</strong></p><p>當您在網站下訂單時, 您會收到一個預期送貨時間的提示。我們團隊會盡力於預計時間內完成送貨, 但不能保證一定能於預計時間內把貨品送到您手上。</p><p>我們為每個訂單於運送過程中投保, 直至商品送到或被提取。提取商品時, 您需要簽署收取商品確認。簽署後, 您開始為商品承擔責任。如果取貨人不是原來購買者, 或者交付的是禮物, 即表示您接受上述人士的簽署確認為送貨證據並表示我們已完成您的訂單, 同時接受相關的責任轉移。我們保留在沒有事先通知下自行決定更新送貨政策的權利。</p><p><strong>退貨</strong></p><p>我們希望為您提供最佳的網上購物體驗, 因此設有免費、不問原因的退貨政策。如果因為任何原因未能對商品百分百滿意, 您可以退還商品並獲得全額退款。</p><p>a) 客戶可以在訂購後7天內退還商品。</p><p>b) 退還的商品必須維持原狀: 即未經穿著/使用, 放於沒受損壞原裝品牌包裝盒及包裝袋, 而且所有價錢牌均完好無缺。</p><p>如果希望退還商品, 請填妥送貨時收到的退貨表格, 連同附有原本包裝的商品寄回我們的地址。如果您沒有保留購買表格, 請致電我們的客戶服務團隊, 我們會以電郵方式補發給您。</p><p>請注意, 退貨時不設退還運費。</p><p><strong>您的權利</strong></p><p>本服務條款無意影響您根據臺灣法律所享有的權利。</p><p><strong>責任</strong></p><p>商品售賣於本網站的設計師、公司或第三方及其關聯人士向任何媒體所表達的觀點純屬其個人意見。我們對任何此等觀點概不負責, 而此等觀點不一定反映本公司的觀點。</p><p>我們不保證使用本網站和服務均為無誤, 也不保證本網站或支援本網站的伺服器沒有病毒或其他有害成分。我們建議所有本網站的用戶確保自己已安裝最新軟件, 包括防毒軟件。</p><p>某些事情可能在本公司的合理監管之外發生, 例如惡劣天氣。在此等情況下, 我們會盡力維持服務, 但對於任何未能滿足本服務條款的責任概不負責。</p><p><br/></p>',0,0,0,1543832430),(5,6,'隱私協議','','','',1,0,'<p><strong>隱私聲明&nbsp;</strong></p><p>我們十分重視客戶的隱私。因此, 我們只會根據本隱私聲明擬 定之方式收集及使用您的個人資料。</p><p>1) 在有必要或與交易有關時向您收集資料。</p><p>2) 在法例要求或與收集用途有關時才會保留您的資料。</p><p>您可以在不提供個人資料的情況下瀏覽我們網站。在沒有登入用戶帳號瀏覽我們的網站時, 您將會以匿名身份瀏覽, 而我們無法辦出您的身份。</p><p>我們十分樂意聆聽您的意見。若您有任何意見或建議, 請將有關資料電郵至在線客服</p><p><strong>個人資料收集</strong></p><p>我們不會向第三方出售、分享或買賣網上收集的客戶個人資料。網上收集的個人資料僅於本公司集團內披露以供內部使用。下单時, 我們將向您收集的基本個人資料包含:</p><p>1) 姓名</p><p>2) 送貨地址</p><p>3) 電郵地址</p><p>4) 聯絡電話號碼</p><p>5) 出生日期</p><p>6) 性別</p><p><strong>我們所向您收集的個人資料將會作為以下用途:</strong></p><p>1) 運送您所購買的商品</p><p>2) 提供商品運送狀況和客戶支援的最新消息</p><p>3) 為您提供有關商品的資料</p><p>4) 處理您的訂單, 或根據您的要求或透過我們網站提供服務和資訊</p><p>此外, 我們也會使用您所提供的資料管理您的帳戶; 驗證及進行您的網上付款有關交易; 審查從我們網站下載的資料; 辨識網站瀏覽器; 做網站用戶統計進行調查; 在您表明不拒絕接收訊息的情況下, 發送我們認為適合您的相關商品或服務資訊。</p><p>我們可能會將您的姓名和地址交給第三者 (例如速遞公司或供應商), 以方便送貨。</p><p>注：速遞公司有權要求您填寫身份證號碼，爲了提供海關內部查閱和核對以方便安排出口。</p><p>我們可能會保留您的訂單資料, 但基於保安理由, 我們不能直接檢索該資料。您可以登入帳戶, 存取訂單資料, 查詢個人訂單資料。您也可以管理個人地址、銀行資料和已訂閱的電子報。您有責任確保個人資料保密, 並不會讓未授權的第三方得到這些資料。我們不會承擔任何不當使用密碼的責任。</p><p><strong>個人資料安全</strong></p><p>我們確保會安全和保密地保存所有收集到的資料。我們會以下列方式保護您的個人資料:</p><p>1) 限制存取個人資料</p><p>2) 維護科技產品防止未經授權存取電腦資料</p><p>3) 當資料沒有保留作記綠的用途, 我們會在安全情況下銷毀您的個人資料</p><p>我們使用128位元安全通訊端層保密技術 (SSL) 處理您的財務資料。128位元安全通訊端層保密技術大約需要至少一萬億年破解, 並且為業界標準的安全措施。</p><p><strong>個人資料披露</strong></p><p>除了提供我們網站送貨服務的相關公司及相關第三方以外, 我們不會將您的個人資料分享給其他機構。</p><p>在特殊情況下, 我們網站可能會被要求披露個人資料, 例如: 在有理由相信的情況下披露個人資料有助阻止生命或健康受到威脅, 或作執法用途。</p><p>如果你認為我們網站違反了隱私條例, 請聯繫在線客服</p><p><strong>電腦數據收集</strong></p><p>當您瀏覽我們網站時, 本公司的伺服器會自動記錄您的瀏覽器所傳送的資料。資料包括:</p><p>- 您的電腦IP地址</p><p>- 瀏覽器類別</p><p>- 瀏覽我們網站前所瀏覽的網頁</p><p>- 在我們網站內瀏覽的頁面</p><p>- 於上述頁面的使用時間、於我們網站搜尋的產品及資料、存取時間及日期, 以及其他統計數據。</p><p>收集所得的資料會用作分析和評估, 從而幫助改善本網站及我們提供的服務和產品。這些資料不會與其他個人資料一同使用。</p><p><strong>隱私聲明更改</strong></p><p>我們網站保留隨時修改和更改隱私聲明的權利。</p><p>有關違反隱私條例的投訴</p><p>如果對我們處理客戶隱私或投訴的方法有任何不滿, 請聯絡我們。</p><p><br/></p>',0,0,0,1543832590);
